import { newKitFromWeb3 } from '@celo/contractkit'
import { setCode, testWithAnvilL1 } from '@celo/dev-utils/lib/anvil-test'
import Web3 from 'web3'
import { stripAnsiCodesFromNestedArray, testLocallyWithWeb3Node } from '../../test-utils/cliUtils'
import PrepareHotfix from './preparehotfix'

process.env.NO_SYNCCHECK = 'true'

const GOVERNANCE_1410_BYTECODE =
  ''

testWithAnvilL1('governance:preparehotfix cmd', (web3: Web3) => {
  const HOTFIX_HASH = '0x8ad3719bb2577b277bcafc1f00ac2f1c3fa5e565173303684d0a8d4f3661680c'

  it('fails when preparing a hotfix that does not exist', async () => {
    const [approverAccount] = await web3.eth.getAccounts()

    await expect(
      testLocallyWithWeb3Node(
        PrepareHotfix,
        ['--hash', HOTFIX_HASH, '--from', approverAccount],
        web3
      )
    ).rejects.toMatchInlineSnapshot(`[Error: Some checks didn't pass!]`)
  })

  it('fails when hotfix does not exist on 1.4.1.0 version', async () => {
    const logMock = jest.spyOn(console, 'log')
    const kit = newKitFromWeb3(web3)
    const governanceWrapper = await kit.contracts.getGovernance()
    const [approverAccount] = await web3.eth.getAccounts()

    await setCode(web3, governanceWrapper.address, GOVERNANCE_1410_BYTECODE)

    await expect(
      testLocallyWithWeb3Node(
        PrepareHotfix,
        ['--hash', HOTFIX_HASH, '--from', approverAccount],
        web3
      )
    ).rejects.toMatchInlineSnapshot(`[Error: Some checks didn't pass!]`)

    expect(stripAnsiCodesFromNestedArray(logMock.mock.calls)).toMatchInlineSnapshot(`
      [
        [
          "Running Checks:",
        ],
        [
          "   ✘  Hotfix 0x8ad3719bb2577b277bcafc1f00ac2f1c3fa5e565173303684d0a8d4f3661680c is whitelisted by quorum of validators ",
        ],
        [
          "   ✔  Hotfix 0x8ad3719bb2577b277bcafc1f00ac2f1c3fa5e565173303684d0a8d4f3661680c is not already executed ",
        ],
        [
          "   ✔  Hotfix 0x8ad3719bb2577b277bcafc1f00ac2f1c3fa5e565173303684d0a8d4f3661680c not already prepared for current epoch ",
        ],
      ]
    `)
  })
})
